<script>
	import Toast from '@/wxcomponents/vant/dist/toast/toast';
	export default {
		data() {
			return {
				show_msg: false,
				nikeName: '',
				show_namedailod: false,
				// userinfo: {
				// 	avatarUrl: require("@/static/image/usercenter_04.png"),
				// 	nikeName: '请点击登录',
				// },
				isLogin: false,
				iflg_msg: 'Hi，歡迎來到~~',
				iflg_msg2: '查看或編輯個人資料>>',
				user_pay: {
					iConfirmNumber: 0,
					iNoConfirmNumber: 0
				},
				isdot: false,
				user_headico: require("@/static/image/usercenter_04.png"),
				index_ico: require("@/static/image/shouye.png"),
				index_ico_h: require("@/static/image/shouye_hover.png"),
				cz_ico: require("@/static/image/chongzhi.png"),
				cz_ico_h: require("@/static/image/chongzhi_hover.png"),
				kf_ico: require("@/static/image/kefu.png"),
				kf_ico_h: require("@/static/image/kefu_hover.png"),
				user_ico: require("@/static/image/wode.png"),
				user_ico_h: require("@/static/image/wode_hover.png"),
				userinfo:{}
			}
		},
		methods: {

			jump(type) {
				if (type == 1) {
					uni.navigateTo({
						url: '/pages/index/index',
					});
				} else if (type ==2)  {
					uni.navigateTo({
						url: '/pages/recharge/recharge',
					});
				}else if (type ==3)  {
					uni.navigateTo({
						url: '/pages/kefu/kefu',
					});
				}else if (type ==4)  {
					uni.navigateTo({
						url: '/pages/usercenter/usercenter',
					});
				}
			},

			formatNum: function(value) {
				if (!value && value !== 0) return 0;
				let str = value.toString();
				let reg =
					str.indexOf(".") > -1 ? /(\d)(?=(\d{3})+\.)/g : /(\d)(?=(?:\d{3})+$)/g;
				return str.replace(reg, "$1,");
			},
			set_username() {
				this.nikeName = this.userinfo.user_nickname
				this.show_namedailod = !this.show_namedailod

			},
			set_username_ok() {
				if (this.nikeName !== '') {
					this.set_userInfo_name()
				} else {
					Toast.fail('請設置暱稱');

				}
			},
			async set_userInfo_name() {
				Toast.loading({
					duration: 0,
					message: '加載中...',
					forbidClick: true,
				});
				const res = await this.$myRuquest({
					url: '/api/front/user/changeNickname',
					method: 'post',
					data: {
						nickname: this.nikeName
					},
					
				})

				if (res.code == 200) {
					Toast.clear();
					this.show_namedailod = false
					Toast.success('設置成功');
					this.get_userInfo()
				} else {
					Toast.clear();
					Toast.fail(res.msg);
				}

			},
			async get_userInfo() {
				const res = await this.$myRuquest({
					url: '/api/front/user/getUserInfo',
					method: "POST",
				})
				if (res.code == 200) {
					this.userinfo = res.data
					
				}
			
			},
			async login_out() {
				const res = await this.$myRuquest({
					url: '/api/front/user/logout',
					method: "POST",
				})
				if (res.code == 200) {
					uni.removeStorageSync('token')
					uni.navigateTo({
						url: '/pages/index/index',
					});
					
				}
			
			},
			go_page(type) {
				if (type == 1) {
					uni.navigateTo({
						url: '/pages/usercenter/qianbao/qianbao',
					});
				} else if (type == 2) {
					uni.navigateTo({
						url: '/pages/recharge/recharge',
					});
				} else if (type == 3) {
					uni.navigateTo({
						url: '/pages/getcash/getcash',
					});
				} else if (type == 4) {
					uni.navigateTo({
						url: '/pages/usercenter/bet_record/bet_record',
					});
				} else if (type == 5) {
					uni.navigateTo({
						url: '/pages/usercenter/updatepsw/updatepsw',
					});
				} else if (type == 6) {
					this.show_msg = true
				}
			},
			onClose() {
				this.show_msg = !this.show_msg
			},
			onOk() {
				//退出操作
				this.login_out()
				
			}
		},
		onLoad() {
			//this.getStorage()
			uni.setBackgroundColor({
				backgroundColor: '#F7F8FC',
			});
		},
		onShow() {
			var had_token = uni.getStorageSync('token')
			if (had_token == '') {
				uni.navigateTo({
					url: '/pages/login/login',
				});
			} else {
				this.get_userInfo()
				//this.userinfo = JSON.parse(uni.getStorageSync("userinfo"))
			}


		}
	}
</script>

